import React from 'react';
import HeaderButton from './HeaderButton.jsx';
import NewButton from './NewButton.jsx';
import '../styles/Header.css';
// Header 컴포넌트 정의
function Header() {
  const headerStyle = {
      backgroundColor: '#D4D2E3',
      color: '#5D5A88',
      padding: '20px',
      position: 'relative',
      display: 'flex',
      justifyContent: 'left',
      alignItems: 'center',
      gridArea: 'header',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
    }
  return (
    <div id="header">
      <h2>⚖️BALANCE-TALK⚖️</h2>
      <div class="main-buttons"><NewButton ></NewButton>
        <HeaderButton name='Login'></HeaderButton>
        <HeaderButton name='Register'></HeaderButton></div>
    </div>  
  )
}

export default Header;
